// App.js
import React from 'react';
import Card from './Components/Card';

const App = () => {
  const handleButtonClick = () => {
    alert('Button clicked!');
  };

  return (
    <div className="app">
      <Card
        title="Example Card"
        description="Walking through sprawling fields of blooming flowers is the perfect way to celebrate Spring. I had been looking forward to visiting these fields for months and it was such a gorgeous day when we arrived. The fields are located in Carlsbad in Southern California, about 40 miles north of San Diego."
        imageUrl="https://in.pinterest.com/pin/837388124449804667/"
        buttonText="Click me"
        onButtonClick={handleButtonClick}
      />
    </div>
  );
};

export default App;
